  //LandingPage() 들어오자마자 실행한다
  useEffect(() => {
    axios.get('/api/hello')
    .then(response => console.log(response.data))
  }, [])

  //const [coinApiKey] = useState("")

  const onSubmitHandler = (event) => {
    event.preventDefault();
    startTrading();
