      width: '100%', height: '100vh'
    }}>
      <form onSubmits={onSubmitHandler}>
        <button type="submit" id="tradingStartBtn"  alt="자동매매 시작하기">
          <img src="/Users/jeongdahyun/Documents/boiler-plate/client/src/components/views/LandingPage/tradingStartBtn.svg" alt="start"></img>
          자동매매 시작
        </button>
      </form>
    </div>
  )
}

export default LandingPage
